import React from "react";

import {
	Container,
	Cabecalho,
	Titulo,
	BotaoCriar,
	Usuario,
	Perfil,
	FormularioEdicao,
} from "./PerfilUsuarioElementos";

const PerfilUsuario = () => {
	return (
		<Container>
			<Cabecalho>
				<Titulo>Editar Perfil</Titulo>
				<BotaoCriar>Criar</BotaoCriar>
			</Cabecalho>

			<Usuario>
				<Perfil></Perfil>
				<FormularioEdicao></FormularioEdicao>
			</Usuario>
		</Container>
	);
};

export default PerfilUsuario;
